import React from 'react';
import profilepic from './profilepic.jpg';
const ProfileScreen = ()=>{
    return(
        <div>
            <div>
                <div style={{
                    display:"flex",
                    justifyContent: "space-around",
                    margin: "18px 0px"
                }}>
                    <img style={{width:"160px", height:"160px", borderRadius:"80px"}}
                    src={profilepic}
                    />
                </div>
                <div>
                    <h4>Name holder</h4>
                </div>
            </div>
        </div>
    )
}

export default ProfileScreen
